(()=>{const e=e=>{e.currentTarget.closest(".navbar-item").classList.toggle("is-active")},t=document.querySelectorAll(".navbar-item.has-dropdown > .navbar-link");for(const a of t)a.addEventListener("click",e);const a=document.querySelector(".navbar-burger"),s=document.querySelector(".navbar-menu");a.addEventListener("click",()=>{s.classList.toggle("is-active"),a.classList.toggle("is-active"),a.setAttribute("aria-expanded",a.classList.contains("is-active")?"true":"false")})})();